import '../App.css';
import './Contact.css';

const Contact = (props) => {
    return (
        <div className="Contact flex">
            <form className="Contact-form flex">
                <label for="firstName">First Name: </label>
                <input for="firstName" type="text" name="firstName" placeholder="First name...." tabIndex="1"></input>
                <label for="lastName">Last Name: </label>
                <input for="lastName" type="text" name="lastName" placeholder="Last name..." tabIndex="2"></input>
            </form>
        </div>
    );
}

export default Contact;
